import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/home/logo.svg';
import avatar from '../assets/home/icons/CheckIn/avatar.svg';
import tickets from '../assets/home/icons/Tours/ticket.svg';
import logOutIcon from '../assets/home/icons/CheckIn/logout.svg'; 
import { useDispatch, useSelector } from 'react-redux';
import { setCreatedUser, setLogOut } from '../slices/authSlice';

export default function Header() {
  const dispatch = useDispatch();
  const currentUser = useSelector((state) => state.auth.currentUser);

  useEffect(() => {
    const storedUser = localStorage.getItem('currentUser');
    if (storedUser) {
      dispatch(setCreatedUser(JSON.parse(storedUser)));
    }
  }, [dispatch]);

  return (
    <header>
      <Link to='/'>
        <img className="logo" src={logo} alt="Tours to Tuscany" />
      </Link>

      <nav className="setUp">
        <li><Link to='/'>Home</Link></li>
        <li><Link to='/aboutUs'>About us</Link></li>
        <li><Link to='/Tours'>Tours</Link></li>
        <li><Link to='/contact'>Contact Us</Link></li>
      </nav>

      <section className="options">
        <select>
          <option>ENG</option>
          <option>UKR</option>
        </select>

        {currentUser ? (
          <UserHeader dispatch={dispatch} />
        ) : (
          <>
            <Link to="/auth/login"><span>Login</span></Link>
            <Link to="/auth/createAccount">
              <button className="general_btn">Sign Up</button>
            </Link>
          </>
        )}
      </section>
    </header>
  );
}

function UserHeader({ dispatch }) {
  return (
    <section className="custom_container">
      <button>
        <img 
        style={{height:'1.6em',width:'1.6em',borderRadius:'100%'}}
        src={avatar} alt="User avatar" />
      </button>

      <select>
<option>
  <Link to="/account/tickets" className="dropdown_item">
  <section >
      <img src={tickets} alt="tickets" />
      <span>My Tickets</span>
  </section>
          
        </Link>
</option>
<option>
  <button className="dropdown_item" onClick={() => dispatch(setLogOut())}>
          <img src={logOutIcon} alt="logout" />
          <span>Logout</span>
        </button>
</option>

      
      <section className="dropdown_menu">
        

        

      </section>
      </select>
    </section>
  );
}
